class Class extends Component {
    state = {
        name : "Nazish"
    }
     update = () => {
        this.setState({
           name: "Asghar"
        })
    }
    render() {
        return (
            <div>
                {this.state}
                <button onClick={this.update}>Click</button>
            </div>
        );
    }
}
